import React, { Component } from 'react'

export default class ItemList extends Component {
    constructor() {
        super()
        this.state = {
            list: ''
        }
    }

    componentDidMount() {
        fetch('/all/listing')
            .then(res => res.json())
            .then(res => setState({
                list: res
            }))
    }
    render() {


        return (
            <div>

            </div>
        )
    }
}
